ncelledDragging\":\"Cancelled dragging.\",\"correctAnswer\":\"Correct answer:\",\"feedbackHeader\":\"Feedback\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"enableCheckButton\":true,\"instantFeedback\":false},\"scoreBarLabel\":\"You got :num out of :total points\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\",\"textField\":\"In 1860, the famous French scientist Louis Pasteur discovered the existence of *microorganisms* in the environment. He proved that some microbes, called *pathogens*,may cause infections if they contaminate the human body.\\nAsepsis is a set of procedures that prevent contamination by *bacteria*, parasites or viruses. It protects the human body from diseases. \\nIn surgery rooms, it is necessary to destroy all bacteria by *sterilizing*the instruments (through heating or radiations) and to clean all surfaces with a *disinfectant* (such as bleach) which slows down the proliferation of microbes.\\nFor surgeons, washing thoroughly their hands with water and anti-microbial soap as well as wearing *sterilized* gloves and a cap is a routine measure to avoid *contamination* of the patient.\",\"media\":{\"disableImageZooming\":false},\"submitAnswer\":\"Submit\"},\"library\":\"H5P.DragText 1.10\",\"metadata\":{\"contentType\":\"Drag the Words\",\"license\":\"U\",\"title\":\"Untitled Drag Text\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Untitled Drag Text\"},\"subContentId\":\"ac03ab9b-8dae-43f4-aa94-b052b0695f97\"},\"useSeparator\":\"disabled\"}]}","library":"H5P.Column 1.15","contentUrl":".","metadata":{"license":"CC BY-NC-ND","title":"Asepsis","defaultLanguage":"und","authors":[{"name":"LAL-Tabshoura","role":"Author"}],"licenseVersion":"4.0"},"scripts":["/h5p/libraries/H5P.AdvancedText-1.1/te
